import React from 'react'
import './myStyle.css'
import Card from './Card'
import Card2 from './Card2'


function CardBox() {
  return (
    <div className='cardBox'>
      <Card numero="30" frase="KS"  />
      <Card2 numero="40" frase="Gini"  />
      <Card3 numero="12" frase="Variables"  />
    </div>
  )
}

export default CardBox;
